import { useState, useEffect } from "react";

function App() {
    const [loading, setLoading] = useState(true);
    useEffect(() => {
        fetch(`https://yts.mx/api/v2/list_movies.json?minimum_rating=8.8&sort_by=year`)
    }, [])
    return (
        <div>
            {loading ? <h1>Loading...</h1> : null}
        </div>
    );
}

export default App;
